tion": "The full resource name of an integrated sql instance" } }, "id": "SqlIntegration" }, "GoogleCloudManagedidentitiesV1beta1OpMetadata": { "type": "object", "description": "Represents the metadata of the long-running operation.", "properties": { "createTime": { "description": "Output only. The time the operation was created.", "readOnly": true, "type": "string", "format": "google-datetime" }, "apiVersion": { "type": "string", "readOnly": true, "description": "Output only. API version used to start the operation." }, "requestedCancellation": { "type": "boolean", "readOnly": true, "description": "Output only. Identifies whether the user has requested cancellation of the operation. Operations that have successfully been cancelled have Operation.error value with a google.rpc.Status.code of 1, corresponding to `Code.CANCELLED`." }, "target": { "description": "Output only. Server-defined resource path for the target of the operation.", "readOnly": true, "type": "string" }, "verb": { "readOnly": true, "type": "string", "description": "Output only. Name of the verb executed by the operation." }, "endTime": { "readOnly": true, "format": "google-datetime", "type": "string", "description": "Output only. The time the operation finished running." } }, "id": "GoogleCloudManagedidentitiesV1beta1OpMetadata" }, "ReconfigureTrustRequest": { "description": "Request message for ReconfigureTrust", "id": "ReconfigureTrustRequest", "type": "object", "properties": { "targetDnsIpAddresses": { "items": { "type": "string" }, "description": "Required. The target DNS server IP addresses to resolve the remote domain involved in the trust.", "type": "array" }, "targetDomainName": { "description": "Required. The fully-qualified target domain name which will be in trust with current domain.", "type": "string" } } }, "GoogleCloudSaasacceleratorManagementProvidersV1PerSliSloEligibility": { "id": "GoogleCloudSaasacceleratorManagementProvidersV1PerSliSloEligibility", "description": "PerSliSloEligibility is a mapping from an SLI name to eligibility.", "type": "object", "properties": { "eligibilities": { "type": "object", "description": "An entry in the eligibilities map specifies an eligibility for a particular SLI for the given instance. The SLI key in the name must be a valid SLI name specified in the Eligibility Exporter binary flags otherwise an error will be emitted by Eligibility Exporter and the oncaller will be alerted. If an SLI has been defined in the binary flags but the eligibilities map does not contain it, the corresponding SLI time series will not be emitted by the Eligibility Exporter. This ensures a smooth rollout and compatibility between the data produced by different versions of the Eligibility Exporters. If eligibilities map contains a key for an SLI which has not been declared in the binary flags, there will be an error message emitted in the Eligibility Exporter log and the metric for the SLI in question will not be emitted.", "additionalProperties": { "$ref": "GoogleCloudSaasacceleratorManagementProvidersV1SloEligibility" } } } }, "ListBackupsResponse": { "id": "ListBackupsResponse", "properties": { "unreachable": { "type": "array", "description": "Locations that could not be reached.", "items": { "type": "string" } }, "backups": { "items": { "$ref": "Backup" }, "description": "A list of Cloud AD backups in the domain.", "type": "array" }, "nextPageToken": { "type": "string", "description": "Token to retrieve the next page of results, or empty if there are no more results in the list." } }, "type": "object", "description": "ListBackupsResponse is the response message for ListBackups method." }, "ListLocationsResponse": { "type": "object", "id": "ListLocationsResponse", "properties": { "nextPageToken": { "type": "string", "description": "The standard List next-page token." }, "locations": { "description": "A list of locations that matches the specified filter in the request.", "items": { "$ref": "Location" }, "type": "array" } }, "descr